import { Box, Button, Grid, IconButton, InputAdornment, TextField, Typography } from "@mui/material"
import { useEffect, useState } from "react"
import Paciente from '../cita_semanal/Paciente'
import CloseIcon from '@mui/icons-material/Close';
import axios from "axios";
import useAuth from "src/hooks/useAuth";
import useLayoutContext from "src/hooks/useAuthLayout";
import swal from 'sweetalert';

export default function Index() {
    const { user } = useAuth()
    const { mostrarComponent } = useLayoutContext()
    const [selected, setSelected] = useState({ paciente: { item: null, selected: false } })
    const [textPersonales, setTextPersonales] = useState([
        { id: 'examen', label: 'EXAMEN:', value: '', type: 'text', tipo: 'text', xs: 12, lg: 6, md: 6, onchanged: (e) => handleChangedText(e), display: true },
        { id: 'cia', label: 'CIA:', value: '', type: 'text', tipo: 'text', xs: 12, lg: 6, md: 6, onchanged: (e) => handleChangedText(e), display: true },
        { id: 'informe', label: 'INFORME:', value: '', type: 'text', tipo: 'textArea', xs: 12, lg: 12, md: 12, onchanged: (e) => handleChangedText(e), display: true },
    ]);
    const [informeDetalle, setInformeDetalle] = useState([])
    const [conclusion, setConclusion] = useState([])
    const [firma, setFirma] = useState('')
    const [imagenes, setImagenes] = useState([])

    useEffect(() => {
        if (user.datos.numero_documento === '10007967') {
            setFirma(`data:image/png;base64,`)
        }
        /*
        if (user.datos.numero_documento === '44732805') {
            setFirma(`data:image/png;base64,`)
        }
        */
    }, [user])

    const handleSleccionarPaciente = (id, item) => {
        setSelected(x => {
            return {
                ...x,
                [id]: {
                    item,
                    selected: true
                }
            }
        })
    }
    const handleLimpiarAll = () => {
        setSelected({ paciente: { item: null, selected: false } })
    }
    const handleChangedText = async (e) => {
        setTextPersonales(x => x.reduce((arr, item) => {
            arr.push({
                ...item,
                value: item.id === e.target.name ? e.target.value : item.value,
            })
            return arr;
        }, []))
    }
    const handleChangedTextLista = async (e) => {
        setInformeDetalle(x => x.reduce((arr, item) => {
            arr.push({
                ...item,
                value: item.id === e.target.name ? e.target.value : item.value,
            })
            return arr;
        }, []))
    }
    const handleChangedTextConclusion = async (e) => {
        setConclusion(x => x.reduce((arr, item) => {
            arr.push({
                ...item,
                value: item.id === e.target.name ? e.target.value : item.value,
            })
            return arr;
        }, []))
    }
    const handleChangedTextImagenes = async (e) => {
        let file = e.target.files[0]
        let reader = new FileReader();
        reader.readAsDataURL(file);
        reader.onload = function () {
            console.log(reader.result);
            setImagenes(x => x.reduce((arr, item) => {
                arr.push({
                    ...item,
                    value: item.id === e.target.name ? reader.result : item.value,
                })
                return arr;
            }, []))
        };
        reader.onerror = function (error) {
            console.log('Error: ', error);
        };
    }
    const handleAddConclusion = () => {
        let cantidad = conclusion.length + 1
        setConclusion(x => [...x, { id: 'id_' + cantidad, label: 'CONCLUSIÓN ' + cantidad + ':', value: '', type: 'text', tipo: 'text', xs: 12, lg: 12, md: 12 },])
    }
    const handleAddInformeDetalle = () => {
        let cantidad = informeDetalle.length + 1
        setInformeDetalle(x => [...x, { id: 'id_' + cantidad, label: 'LISTA ' + cantidad + ':', value: '', type: 'text', tipo: 'text', xs: 12, lg: 12, md: 12 },])
    }
    const handleAddImagenes = () => {
        let cantidad = imagenes.length + 1
        setImagenes(x => [...x, { id: 'id_' + cantidad, label: 'Imagen ' + cantidad + ':', value: '', type: 'file', xs: 12, lg: 12, md: 12 },])
    }
    const handleRemoveConclusion = (id) => {

        setConclusion(con => con.filter(x => x.id !== id).reduce((arr, item, ix) => {
            let valor = parseInt(ix) + 1
            arr.push({ ...item, id: 'id_' + valor, label: 'CONCLUSIÓN ' + valor + ':' })
            return arr
        }, []))


    }
    const handleRemoveInformeDetalle = (id) => {

        setInformeDetalle(inf => inf.filter(x => x.id !== id).reduce((arr, item, ix) => {
            let valor = parseInt(ix) + 1
            arr.push({ ...item, id: 'id_' + valor, label: 'LISTA ' + valor + ':' })
            return arr
        }, []))

    }
    const handleRemoveImagenes = (id) => {

        setImagenes(con => con.filter(x => x.id !== id).reduce((arr, item, ix) => {
            let valor = parseInt(ix) + 1
            arr.push({ ...item, id: 'id_' + valor, label: 'Imagen ' + valor + ':' })
            return arr
        }, []))


    }
    const handleGuardar = async () => {

        let persona = selected.paciente.item
        let lista = ''
        let conclu = ''
        let img12 = ''
        informeDetalle.map(x => {
            lista += `<li style="text-align: left;"><p>${x.value}</p></li>`
            return false
        })
        conclusion.map(x => {
            conclu += `<li style="text-align: left;"><p><b>${x.value}</b></p></li>`
            return false
        })
        imagenes.map(x => {
            img12 += `<div class="col-lg-4" style="align-items: center;"><img src="${x.value}"  width="200" height="200"/></div>`
            return false
        })
        let fecha = new Date().toISOString().split('T')[0]
        let formarFecha = fecha.split('-')[2] + '/' + fecha.split('-')[1] + '/' + fecha.split('-')[0]
        let nombres = persona.Des_ApePaterno + ' ' + persona.Des_ApeMaterno + ' ' + persona.Des_Nombres
        let html = `
        
        <style>
        h1 { font-family: Arial, "Helvetica Neue", Helvetica, sans-serif; font-size: 24px; font-style: normal; font-variant: normal; font-weight: 700; line-height: 26.4px; } h3 { font-family: Arial, "Helvetica Neue", Helvetica, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: 700; line-height: 15.4px; } 
        p { font-family: Arial, "Helvetica Neue", Helvetica, sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; line-height: 20px; } blockquote { font-family: Arial, "Helvetica Neue", Helvetica, sans-serif; font-size: 21px; font-style: normal; font-variant: normal; font-weight: 400; line-height: 30px; } pre { font-family: Arial, "Helvetica Neue", Helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: 400; line-height: 18.5714px; }
        </style>
        <br>
        <br>
        <br>
        <br>
        <br>
        <br>
        <br>
        <div style="padding:30px;">
        <hr style="height:1px;border:none;color:#333;background-color:#333;" />
        <p><strong>PACIENTE:&nbsp;</strong>${nombres}&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>H.Cl.N&ordm;:</strong>${persona.Nro_Historia}</p>
        <p><strong>FECHA:&nbsp;</strong>${formarFecha}&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>EXAMEN:</strong><strong>${textPersonales.find(x => x.id === 'examen').value}</strong></p>
        <p><strong>INDICACION DEL DR(A):&nbsp;</strong>Julio Ramon M.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>CIA:</strong>${textPersonales.find(x => x.id === 'cia').value}</p>
        <hr/>
        <p style="text-align: center;"><span style="text-decoration: underline;"><strong>INFORME</strong></span></p>
        <p style="text-align: justify;"><strong>${textPersonales.find(x => x.id === 'informe').value}</strong></p>
        <ul>
            ${lista}
        </ul>
        <p>CONCLUSI&Oacute;N:</p>
        <ul>
        ${conclu}
        </ul>
        <div class="row">
        ${img12}
        

            
        </div>
       
        <p style="margin-left: 230px;">Atentamente</p>
        <p  style="margin-left:230px;">
            <img src="${firma}"  width="200" height="200"/>
        </p>
        </div>
       `
        let nombresFinal = ''
        nombres.split('').map(x => {
            if (x !== ' ') {
                nombresFinal += x
            }
            return false
        })
        const enviar = await axios.post(`http://200.121.91.211:4001/generarPdf`, {
            contenido: html,
            historia: persona.Nro_Historia,
            documento: user.datos.numero_documento,
            ruta: '\\ECO-HUAYANAY\\',
            rutaTexto: 'ECO-HUAYANAY',
            titulo: nombresFinal + '_' + fecha,
        })
        if (enviar.status === 200) {
            mostrarComponent({
                contenido: '',
                estado: false,
            }, 'drawerOpen')
            swal({
                title: 'Correcto',
                text: 'Genero su resultado médico sin nigun inconveniente',
                icon: 'success',
                buttons: false,
                timer: 1200
            })
        }

    }

    return (
        <>
            {!selected.paciente.selected && <Paciente handleSleccionarPaciente={handleSleccionarPaciente} />}
            {selected.paciente.selected && <>
                <Grid alignItems="center" justifyContent={"center"} container spacing={3} sx={{ p: 2 }}>
                    <Grid item xs={12} lg={10} md={10}>
                        <Box display="flex" alignItems="center">
                            <Box ml={1.5}>
                                <Typography color="text.primary" variant="h4" noWrap>
                                    {selected.paciente.item.Des_ApePaterno + ' ' + selected.paciente.item.Des_ApeMaterno + ' ' + selected.paciente.item.Des_Nombres}
                                </Typography>
                                <Typography variant="subtitle1" noWrap>
                                    {selected.paciente.item.Nro_DocIdenti}
                                </Typography>
                            </Box>
                        </Box>
                    </Grid>
                    <Grid item xs={12} lg={2} md={2}>
                        <Button variant="outlined" size='small' sx={{ float: 'right' }}
                            onClick={() => handleLimpiarAll()}>
                            Limpiar
                        </Button>
                    </Grid>
                    {textPersonales.filter(x => x.display).map(x => <Grid item xs={x.xs} lg={x.lg} md={x.md} key={x.id}>
                        {
                            x.tipo === 'text' && <TextField
                                fullWidth
                                label={x.label}
                                name={x.id}
                                type={x.type}
                                value={x.value}
                                variant="outlined"
                                onChange={(e) => {
                                    x.onchanged(e)

                                }}
                            />
                        }
                        {
                            x.tipo === 'textArea' && <TextField
                                fullWidth
                                label={x.label}
                                name={x.id}
                                type={x.type}
                                value={x.value}
                                variant="outlined"
                                multiline
                                rows={3}
                                onChange={(e) => {
                                    x.onchanged(e)

                                }}

                            />
                        }

                    </Grid>
                    )}
                    <Grid item xs={12} lg={10} md={10}>
                        <Box display="flex" alignItems="center">
                            <Box ml={1.5}>
                                <Typography color="text.primary" variant="h4" noWrap>
                                    Informe detalle
                                </Typography>
                            </Box>
                        </Box>
                    </Grid>
                    <Grid item xs={12} lg={2} md={2}>
                        <Button variant="outlined" size='small' sx={{ float: 'right' }}
                            onClick={() => handleAddInformeDetalle()}>
                            Agregar
                        </Button>
                    </Grid>
                    {informeDetalle.map(x => <Grid item xs={x.xs} lg={x.lg} md={x.md} key={x.id}>
                        {
                            x.tipo === 'text' && <TextField
                                fullWidth
                                label={x.label}
                                name={x.id}
                                type={x.type}
                                value={x.value}
                                variant="outlined"
                                onChange={(e) => {
                                    handleChangedTextLista(e)

                                }}
                                InputProps={{
                                    endAdornment: (
                                        <InputAdornment position="end">
                                            <IconButton
                                                size="small"
                                                color="secondary"
                                                onClick={() => handleRemoveInformeDetalle(x.id)}
                                            >
                                                <CloseIcon fontSize="small" />
                                            </IconButton>
                                        </InputAdornment>
                                    ),
                                }}
                            />
                        }

                    </Grid>
                    )}

                    <Grid item xs={12} lg={10} md={10}>
                        <Box display="flex" alignItems="center">
                            <Box ml={1.5}>
                                <Typography color="text.primary" variant="h4" noWrap>
                                    Conclusión
                                </Typography>
                            </Box>
                        </Box>
                    </Grid>
                    <Grid item xs={12} lg={2} md={2}>
                        <Button variant="outlined" size='small' sx={{ float: 'right' }}
                            onClick={() => handleAddConclusion()}>
                            Agregar
                        </Button>
                    </Grid>
                    {conclusion.map(x => <Grid item xs={x.xs} lg={x.lg} md={x.md} key={x.id}>
                        {
                            x.tipo === 'text' && <TextField
                                fullWidth
                                label={x.label}
                                name={x.id}
                                type={x.type}
                                value={x.value}
                                variant="outlined"
                                onChange={(e) => {
                                    handleChangedTextConclusion(e)

                                }}
                                InputProps={{
                                    endAdornment: (
                                        <InputAdornment position="end">
                                            <IconButton
                                                size="small"
                                                color="secondary"
                                                onClick={() => handleRemoveConclusion(x.id)}
                                            >
                                                <CloseIcon fontSize="small" />
                                            </IconButton>
                                        </InputAdornment>
                                    ),
                                }}
                            />
                        }

                    </Grid>
                    )}

                    <Grid item xs={12} lg={10} md={10}>
                        <Box display="flex" alignItems="center">
                            <Box ml={1.5}>
                                <Typography color="text.primary" variant="h4" noWrap>
                                    Imagenes
                                </Typography>
                            </Box>
                        </Box>
                    </Grid>
                    <Grid item xs={12} lg={2} md={2}>
                        <Button variant="outlined" size='small' sx={{ float: 'right' }}
                            onClick={() => handleAddImagenes()}
                        >
                            Agregar
                        </Button>
                    </Grid>
                    <Grid item xs={12} lg={12} md={12}>
                        {imagenes.map(x => <Grid item xs={x.xs} lg={x.lg} md={x.md} key={x.id}>
                            {
                                <TextField
                                    fullWidth
                                    label={x.label}
                                    name={x.id}
                                    type={x.type}
                                    variant="outlined"
                                    onChange={(e) => {
                                        handleChangedTextImagenes(e)

                                    }}
                                    InputProps={{
                                        endAdornment: (
                                            <InputAdornment position="end">
                                                <IconButton
                                                    size="small"
                                                    color="secondary"
                                                    onClick={() => handleRemoveImagenes(x.id)}
                                                >
                                                    <CloseIcon fontSize="small" />
                                                </IconButton>
                                            </InputAdornment>
                                        ),
                                    }}
                                />
                            }

                        </Grid>
                        )}
                    </Grid>
                    <Grid item xs={12} lg={12} md={12} sx={{ mt: 2 }}>
                        <Button variant="contained" size='small' fullWidth p={2}
                            onClick={() => handleGuardar()}
                        >
                            Generar
                        </Button>
                    </Grid>
                </Grid>

            </>}
        </>
    )
}
